
from typing import List

class Solution:
    def scoreOfStudents(self, s: str, answers: List[int]) -> int:
        correct_ans = eval(s)
        cache = {}

        def evaluate(s):
            if len(s) == 1:
                return [int(s)]

            if s not in cache:
                answers = set()
                for i, op in enumerate(s):
                    if not op.isdigit():
                        left = s[:i]
                        right = s[i+1:]
                        for lval in evaluate(left):
                            for rval in evaluate(right):
                                if op == '+':
                                    ans = lval + rval
                                else:
                                    ans = lval * rval
                                if ans <= 1000:
                                    answers.add(ans)
                cache[s] = answers
            return cache[s]

        score = 0
        incorrect_ans = evaluate(s)

        for ans in answers:
            if ans == correct_ans:
                score += 5
            elif ans in incorrect_ans:
                score += 2

        return score


